// Home Page -- Samuel Adamson
import '../css/Home.css'
// React Bootstrap
import { Container, Row, Col } from 'react-bootstrap';
// Components
import Fader from './components/Fader';
import SplashStat from './components/SplashStat';


const Home = () => {
    return (
        <div className="Home"> 
            <SplashStat />

            <div className="content">
                <Container>
                    <Fader>
                        <Row>
                            <h1> Value in freedom </h1>
                        </Row>
                    </Fader>
                    <Fader>
                        <Row>
                            <h2> Fiat currencies rely heavily on international governments </h2>
                        </Row>
                    </Fader>
                </Container>
            </div>    
        </div>
    );
}

export default Home;
